import './style.css';
import Logo from '../logo';
import OpcoesHeader from '../opções-header'; 
import styled from 'styled-components';

const hindu = styled.header`
    background-color: #FF3F00;
    display: flex;
`;

function Header() {
    return (
    <hindu>
            <Logo/>
            <OpcoesHeader/>
        </hindu>
    )
}

export default Header;
